  \"2016-10-08T15:56:04.149627\",\n\t\"name\": \"rocky-mountain-arsenal-national-wildlife-refuge-bison-tissue-contaminant-study-data-summar\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Rocky Mountain Arsenal National Wildlife
  Refuge was created on a former Department of Defense site with a history of chemical
  contamination. This document provides a summary of the analytical results of bison
  tissue samples collected to support research into any affects of past contamination
  on future bison management activities. Samples were analyzed for organochlorine
  pesticides (OCPs) and total mercury as identified. OCPs were reported above the
  reporting limit in one fat sample. Mercury was detected in 10/16 kidney samples.
  18 animals and 112 tissue samples were non-detect for all OCPs and 6 animals were
  non-detect for mercury. One animal and one tissue had a detectable dieldrinnconcentration
  (0.021 mg/kg in fat). A total of 10 bison had detectable mercury concentrations
  (0.02 u2013 0.029 mg/kg).\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
